       if ((key != 'F625W') && (key != 'F658N')) {\n            var k = i;\n            if (i > 2) { k = i - 2; }\n            for (j = 0; j < stats.length; j++) {\n                var detector;\n                if ((key == 'F475W') || (key == 'F814W')) {\n                    detector = 'ACS_WFC';\n                } else {\n                    detector = 'WFC3';\n                }\n                var flux_nd = data['logHST_' + detector + '_' + key + '_nd_' + stats[j]][inds];\n                var flux_wd = data['logHST_' + detector + '_' + key + '_wd_' + stats[j]][inds];\n                filt_f['flux_nd_'+stats[j]][k] = flux_nd;\n                filt_f['flux_wd_'+stats[j]][k] = flux_wd;\n            }\n        }\n    }\n    filters.trigger('change');\n    filters_flux.trigger('change');\n    var maxmag = Math.max(...mags);\n    var minmag = Math.min(...mags);\n    var yrange = maxmag - minmag;\n    if (minmag < 16) {\n        y_range.end = minmag-0.1*yrange;\n    } else {\n        y_range.end = 16;\n    }\n    if (maxmag > 28) {\n        y_range.start = maxmag+0.15*yrange;\n    } else {\n        y_range.start = 28;\n    }\n} else {\n    JS9.SetZoom('toFit');\n}\n\nreturn false;\n"},"id":"de8ca7c2-3139-4736-aa9c-62c796c88e4d","type":"CustomJS"},{"attributes":{},"id":"b026f3da-54a1-4b57-883b-5594835d8d07","type":"ToolEvents"},{"attributes":{"below":[{"id":"3c85f989-9668-42bf-ab1a-a92319c929d6","type":"LinearAxis"}],"left":[{"id":"d182cc2b-f646-4be6-b175-55510b43a4a8","type":"LinearAxis"}],"plot_height":350,"plot_width":350,"renderers":[{"id":"3c85f989-9668-42bf-ab1a-a92319c929d6","type":"LinearAxis"},{"id":"1af66cc1-4bd9-4a15-8d4d-f21c972b6893","type":"Grid"},{"id":"d182cc2b-f646-4be6-b175-55510b43a4a8","type":"LinearAxis"},{"id":"b97bf181-3e41-4d0b-b0f2-d845731539d6","type":"Grid"},{"id":"75879686-7344-4dac-8bf6-e1bce4fb79b7","type":"BoxAnnotation"},{"id":"243ab42d-00db-4f8e-84f0-d391701d8cda","type":"GlyphRenderer"},{"id":"cdde6c49-32bd-4693-b1ca-b3090b7058a2","type
